import React, { useState } from 'react'
import Button from '@material-ui/core/Button'

const Practice = () => {
    const [change,funchange]=useState("posts")
    return (
        <div style={{justifyContent:"center" , height:"80vh", display:"flex",alignItems:"center" ,flexDirection:"column"}} >
            <Button variant="text" color="default" onClick={()=>funchange("Hello")} >
              Hello
            </Button>
            <div>
            
               <h4>{change}</h4>
                </div>

        </div>
    )
}

export default Practice
